import React, { useEffect, useState } from "react";
import DBCard from "../../components/ui/DBCard";
import useAuthCheck from "../../hooks/useAuthCheck";

const serverUrl = process.env.REACT_APP_SERVER_URL;

function Dashboard({ theme }) {
  useAuthCheck();
  return (
    <div className="w-full h-full flex flex-grow gap-5">
      <div className="rounded flex flex-col gap-5 w-full p-5 bg-fantasy shadow-md">
        <div className="flex flex-col">
          <label className="text-xs text-grey-200">Username</label>
          <p>PLAYER USERNAME</p>
        </div>
        <div className="flex flex-col">
          <label className="text-xs text-grey-200">Email</label>
          <p>PLAYER EMAIL</p>
        </div>
        <div className="flex flex-col">
          <label className="text-xs text-grey-200">Username</label>
          <p>PLAYER USERNAME</p>
        </div>
      </div>
      {/* <DBCard /> <DBCard /> <DBCard /> <DBCard /> */}
    </div>
  );
}

export default Dashboard;
